.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
.timeline-component {
  cursor: default;
  width: 100%;
  height: 100%;
}
.timeline-component .timeline {
  font-family: helvetica, arial, sans-serif;
  -webkit-tap-highlight-color: transparent;
  cursor: default;
  overflow-y: hidden;
}
.timeline-component .timeline .label,
.timeline-component .timeline .mainArea .label,
.timeline-component .timeline .upperTextCell,
.timeline-component .timeline .lowerTextCell {
  text-anchor: middle;
}
.timeline-component .timeline .selectionCursor {
  fill: gray;
}
.timeline-component .timeline .selectionRangeContainer {
  text-anchor: start;
}
.timeline-component .timeline .periodSlicerSelectionRect,
.timeline-component .timeline .timelineVertLine,
.timeline-component .timeline .cellRect {
  cursor: pointer;
}
.timeline-component .timeline .selectionCursor {
  cursor: ew-resize;
}
.timeline-component .timelineSlicer {
  fill: #000000;
  cursor: pointer;
}
.timeline-component .timelineSlicer .periodSlicerRect {
  stroke: #aaa;
  stroke-width: 2px;
  fill: transparent;
}
.timeline-component .timelineSlicer .periodSlicerGranularities,
.timeline-component .timelineSlicer .periodSlicerSelection {
  font-size: 10px;
  text-anchor: middle;
}
.timeline-component .timelineSlicer .periodSlicerSelectionRect {
  fill: transparent;
}
.timeline-component .timelineSlicer .periodSlicerRect {
  pointer-events: none;
}
.timeline-component .timelineWrapper {
  overflow: auto;
  width: 100%;
}
.timeline-component .logoSvg {
  position: absolute;
  opacity: 0.3;
  transition: opacity 0.3s ease-in-out;
}
.timeline-component .logoSvg:hover {
  cursor: pointer;
  opacity: 1;
}
.timeline-landing-page {
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  background: white;
}
.timeline-landing-page .landing-page-container {
  text-align: center;
  max-width: 250px;
}
.timeline-landing-page .landing-page-container .landing-page-icon {
  display: block;
  margin-bottom: 10px;
  opacity: 0.8;
}
.timeline-landing-page .landing-page-container .landing-page-text {
  color: #666;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 14px;
  line-height: 1.4;
  margin: 0;
}
